#
# TABLE STRUCTURE FOR: tour
#

DROP TABLE IF EXISTS `tour`;

CREATE TABLE `tour` (
  `TourID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` text NOT NULL,
  `Description` text NOT NULL,
  `TourGuideID` int(11) NOT NULL,
  `CountryID` int(11) NOT NULL,
  `StateID` int(11) NOT NULL,
  `Start_date` varchar(100) NOT NULL,
  `End_date` varchar(100) NOT NULL,
  `Price` decimal(10,0) NOT NULL,
  `Group_Size` int(11) NOT NULL,
  `Status` varchar(255) NOT NULL DEFAULT 'YTS',
  PRIMARY KEY (`TourID`),
  KEY `tour_ibfk_1` (`TourGuideID`),
  KEY `tour_ibfk_2` (`CountryID`),
  KEY `tour_ibfk_3` (`StateID`),
  CONSTRAINT `tour_ibfk_2` FOREIGN KEY (`CountryID`) REFERENCES `country` (`CountryID`),
  CONSTRAINT `tour_ibfk_3` FOREIGN KEY (`StateID`) REFERENCES `state` (`StateID`),
  CONSTRAINT `tour_ibfk_4` FOREIGN KEY (`TourGuideID`) REFERENCES `user` (`UserID`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;



